@maintainers From my point of view, this is good to go. Two questions of the form "is there a better way to write this" remain, namely:
- ~~Can one avoid the "_ _ _ _" dance with passing the `ChartedSpace` instance to ContMDiff? Several places. We feel one should be able to use named arguments; I tried locally and it didn't just work.~~ fixed now
- Some proofs on ContMDiff feel a bit painful to me. If there's a nicer way, I'd love to know :-) regardless of whether that's required for this PR. Update: feels better now; I'm always happy to learn new tricks ;-)

